        -moz-box-shadow: 9px 20px 74px 6px rgba(0,0,0,0.34);
        box-shadow: 9px 20px 74px 6px rgba(0,0,0,0.34);

        h4 {
          font-size: 1.6rem;
          margin-top: 2rem;
          margin-bottom: 4rem;
          color: $color3;
        }

        input[type="text"],
        input[type="email"],
        textarea {
          width: 100%;
          background: transparent;
          border: none;
          border-bottom: 2px solid $color5;
          margin-bottom: 2rem;
          font-size: 0.8rem;
          text-transform: uppercase;
          line-height: 1.4;
          color: $color5;
          padding: 15px 0;
        }

        button[type="submit"] {
          background: $color1;
          -webkit-border-radius: 30px;
          -moz-border-radius: 30px;
          border: none;
          border-radius: 30px;
          text-align: center;
          text-decoration: none;
          color: $color3;
          font-size: 1rem;
          padding: 17px 30px;
          text-transform: uppercase;
          width: 100%;
        }
      }
    }

    .contact-section {
      vertical-align: top;
      display: inline-block;
      padding: 56px;
      width: 70%;
      float: right;

      .contact-info {
        h1 {
          font-size: 2.3rem;
          font-weight: 500;
          line-height: 1.2;
          margin: 0 0 1rem;

          span {
            color: $color1;
          }
        }

        .contact-box {
          width: 100%;
          padding: 30px;
          max-width: 600px;
          cursor: pointer;
          transition: all 0.5s ease-in-out;

          &:hover {
            -webkit-box-shadow: 0 20px 74px 6px rgba(0, 0, 0, 0.12);
            -moz-box-shadow: 0 20px 74px 6px rgba(0, 0, 0, 0.12);
            box-shadow: 0 20px 74px 6px rgba(0, 0, 0, 0.12);
          }

          h5 {
            font-size: 1.1rem;
            font-weight: 600;
            margin: 0 0 1.5rem;
          }

          p {
            color: $color5;
            font-weight: 300;
            line-height: 1.4;
            margin: 0 0 2rem;
          }
        }
      }
    }
  }
}

sources.src/scss/main.scss:
@import "reset";
@import "variables";
@import "info-section";
@import "home";
@import "resume";
@import "work";
@import "contact";

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body,
html {
  font-size: 18px;
  font-family: 'Barlow Semi Condensed', sans-serif;
  height: 100vh;
  background: $color1;
}

.menu-icon {
  // background: red;
  position: fixed;
  top: 36px;
  right: 36px;
  padding: 20px;
  z-index: 11;
  cursor: pointer;

  .fas {
    color: $color1;
    font-size: 2rem;
  }
}

.primary-btn {
  background: $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  text-decoration: none;
  color: $color3;
  padding: 15px 30px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  margin-right: 15px;
  transition: $btnTransitions;

  &:hover {
    background: black;
  }
}

.ghost-btn {
  border: 4px solid $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  text-decoration: none;
  color: $color1;
  padding: 12px 27px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  transition: $btnTransitions;

  &:hover {
    border-color: black;
    color: black;
    // background: $color4;
  }
}

#menu {
  background-color: $color1;
  position: fixed;
  width: 100%;
  top: 0;
  bottom: 0;
  z-index: 10;
  display: flex;
  align-items: center;
  justify-content: center;
  opacity: 1;
  transform: translate3d(-100%,0,0);
  transition: all 0.8s ease-in-out;

  nav {
    width: 400px;
    text-align: center;

    a {
      display: block;
      font-size: 2.3rem;
      padding: 1rem;
      text-decoration: none;
      color: white;

      &:hover {
        color: $color5;
      }
    }
  }
}

.menu-active {
  .menu-icon {
    .fas {
      color: black;
    }
  }

  #menu {
    width: 100%;
    // opacity: 1;
    top: 0;
    bottom: 0;
    transform: translate3d(0,0,0);
  }
}

.scroll-section {
  height: 100vh;
  overflow-y: scroll;
  overflow-x: hidden;
  padding: 56px;
}
